{
  "properties": {
    "template": {
      "$schema": "https://schema.management.azure.com/schemas/2019-04-01/deploymentTemplate.json#",
      "contentVersion": "1.0.0.0",
      "parameters": {
        "location": {
          "defaultValue": "[resourceGroup().location]",
          "type": "string",
          "metadata": {
            "description": "Location for all resources."
          }
        },
        "extendedLocation": {
          "type": "string",
          "metadata": {
            "description": "Name of the extended location."
          }
        }
      },
      "variables": {
        "dnsLabelPrefix": "dnsedge",
        "nicName": "EdgeVMNic",
        "addressPrefix": "10.0.0.0/16",
        "subnetName": "Subnet",
        "subnetPrefix": "10.0.0.0/24",
        "publicIPAddressName": "EdgePublicIP",
        "virtualNetworkName": "EdgeVNET",
        "subnetRef": "[resourceId('Microsoft.Network/virtualNetworks/subnets', variables('virtualNetworkName'), variables('subnetName'))]",
        "networkSecurityGroupName": "default-NSG"
      },
      "resources": [
        {
          "type": "Microsoft.Network/publicIPAddresses",
          "apiVersion": "2018-11-01",
          "name": "[variables('publicIPAddressName')]",
          "location": "[parameters('location')]",
          "extendedLocation": {
            "type": "EdgeZone",
            "name": "[parameters('extendedLocation')]"
          },
          "sku": {
            "name": "Standard"
          },
          "properties": {
            "publicIPAllocationMethod": "Static",
            "dnsSettings": {
              "domainNameLabel": "[variables('dnsLabelPrefix')]"
            }
          }
        },
        {
          "type": "Microsoft.Network/networkSecurityGroups",
          "apiVersion": "2019-08-01",
          "name": "[variables('networkSecurityGroupName')]",
          "location": "[parameters('location')]",
          "properties": {
            "securityRules": [
              {
                "name": "default-allow-3389",
                "properties": {
                  "priority": 1000,
                  "access": "Allow",
                  "direction": "Inbound",
                  "destinationPortRange": "3389",
                  "protocol": "Tcp",
                  "sourcePortRange": "*",
                  "sourceAddressPrefix": "*",
                  "destinationAddressPrefix": "*"
                }
              }
            ]
          }
        },
        {
          "type": "Microsoft.Network/virtualNetworks",
          "apiVersion": "2018-11-01",
          "name": "[variables('virtualNetworkName')]",
          "location": "[parameters('location')]",
          "extendedLocation": {
            "type": "EdgeZone",
            "name": "[parameters('extendedLocation')]"
          },
          "dependsOn": [
            "[resourceId('Microsoft.Network/networkSecurityGroups', variables('networkSecurityGroupName'))]"
          ],
          "properties": {
            "addressSpace": {
              "addressPrefixes": [
                "[variables('addressPrefix')]"
              ]
            },
            "subnets": [
              {
                "name": "[variables('subnetName')]",
                "properties": {
                  "addressPrefix": "[variables('subnetPrefix')]",
                  "networkSecurityGroup": {
                    "id": "[resourceId('Microsoft.Network/networkSecurityGroups', variables('networkSecurityGroupName'))]"
                  }
                }
              }
            ]
          }
        },
        {
          "type": "Microsoft.Network/networkInterfaces",
          "apiVersion": "2018-11-01",
          "name": "[variables('nicName')]",
          "location": "[parameters('location')]",
          "extendedLocation": {
            "type": "EdgeZone",
            "name": "[parameters('extendedLocation')]"
          },
          "dependsOn": [
            "[resourceId('Microsoft.Network/publicIPAddresses/', variables('publicIPAddressName'))]",
            "[resourceId('Microsoft.Network/virtualNetworks/', variables('virtualNetworkName'))]"
          ],
          "properties": {
            "ipConfigurations": [
              {
                "name": "ipconfig1",
                "properties": {
                  "privateIPAllocationMethod": "Dynamic",
                  "publicIPAddress": {
                    "id": "[resourceId('Microsoft.Network/publicIPAddresses',variables('publicIPAddressName'))]"
                  },
                  "subnet": {
                    "id": "[variables('subnetRef')]"
                  }
                }
              }
            ]
          }
        }
      ],
      "outputs": {
        "nicId": {
          "type": "string",
          "value": "[resourceId('Microsoft.Network/networkInterfaces',variables('nicName'))]"
        }
      }
    },
    "parameters": {
      "extendedLocation": {
        "value": "MicrosoftRRDCLab1"
      }
    },
    "mode": "Incremental"
  }
}

